tables.table_schema:
CREATE TABLE ModelConfigurations (
    config_id UUID PRIMARY KEY,
    model_id UUID REFERENCES MachineLearningModels(model_id),
    config_name VARCHAR(100) NOT NULL,
    config_value JSONB
);

CREATE TABLE TrainingLogs (
    log_id UUID PRIMARY KEY,
    model_id UUID REFERENCES MachineLearningModels(model_id),
    log_text TEXT NOT NULL,
    log_timestamp TIMESTAMP NOT NULL
);

CREATE TABLE dataset_information (
    id UUID PRIMARY KEY,
    dataset_name VARCHAR(255),
    columns JSONB,
    uploaded_at TIMESTAMP
);

CREATE TABLE experiment_results (
    id UUID PRIMARY KEY,
    experiment_id UUID REFERENCES model_metadata(id),
    evaluation_metrics JSONB,
    completed_at TIMESTAMP
);

CREATE TABLE ModelParameters (
    param_id INT PRIMARY KEY,
    model_id INT REFERENCES MachineLearningModel(model_id),
    param_name VARCHAR(50) NOT NULL,
    param_value JSONB
);

CREATE TABLE ModelConfigurations (
    config_id INT PRIMARY KEY,
    model_id INT REFERENCES MachineLearningModel(model_id),
    config_name VARCHAR(50) NOT NULL,
    config_details JSONB
);
